import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link, useParams, useNavigate } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { fetchShipments, updateShipmentLocation } from "./redux/shipmentSlice";
import MapView from "./MapView";
import "bootstrap/dist/css/bootstrap.min.css";

const Navbar = () => (
  <nav className="navbar navbar-dark bg-dark p-3">
    <Link to="/" className="navbar-brand">Cargo Shipment Tracker</Link>
  </nav>
);

const Dashboard = () => {
  const dispatch = useDispatch();
  const { shipments, loading } = useSelector((state) => state.shipments);

  useEffect(() => {
    dispatch(fetchShipments());
  }, [dispatch]);

  if (loading) return <p>Loading shipments...</p>;

  return (
    <div className="container mt-4">
      <h2>Shipments</h2>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>Shipment ID</th>
            <th>Container ID</th>
            <th>Current Location</th>
            <th>ETA</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {shipments.map((shipment) => (
            <tr key={shipment._id}>
              <td>{shipment.shipmentId}</td>
              <td>{shipment.containerId}</td>
              <td>{shipment.currentLocation}</td>
              <td>{shipment.estimatedArrival}</td>
              <td>
                <Link to={`/shipment/${shipment._id}`} className="btn btn-primary">
                  Get Details
                </Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const ShipmentDetails = () => {
  const { id } = useParams();
  const shipment = useSelector((state) =>
    state.shipments.shipments.find((s) => s._id === id)
  );
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const [newLocation, setNewLocation] = useState("");

  if (!shipment) return <p>Loading shipment details...</p>;

  const handleUpdateLocation = () => {
    dispatch(updateShipmentLocation({ id, newLocation }));
    setNewLocation("");
  };

  return (
    <div className="container mt-4">
      <h2>Shipment Details</h2>
      <p><strong>Shipment ID:</strong> {shipment.shipmentId}</p>
      <p><strong>Container ID:</strong> {shipment.containerId}</p>
      <p><strong>Current Location:</strong> {shipment.currentLocation}</p>
      <p><strong>ETA:</strong> {shipment.estimatedArrival}</p>
      <button className="btn btn-success" onClick={() => navigate(`/shipment/${id}/map`)}>
        Map View
      </button>
      <div className="mt-3">
        <input
          type="text"
          value={newLocation}
          onChange={(e) => setNewLocation(e.target.value)}
          placeholder="Enter new location"
          className="form-control mb-2"
        />
        <button className="btn btn-warning" onClick={handleUpdateLocation}>
          Update Location
        </button>
      </div>
    </div>
  );
};

const App = () => (
  <Router>
    <Navbar />
    <Routes>
      <Route path="/" element={<Dashboard />} />
      <Route path="/shipment/:id" element={<ShipmentDetails />} />
      <Route path="/shipment/:id/map" element={<MapView />} />
    </Routes>
  </Router>
);

export default App;
